import React from 'react';

// import Swap from './mint';
// import Pool from './redeem';
import {
  HeadingText,
  MintRedeemWrapper,
  TabWrapper,
  ToggleBtn,
  ToggleBtnWrapper,
} from './styled';

const MintRedeeem = () => {
  const [activeTab, setActiveTab] = React.useState('Swap');
  return (
    <MintRedeemWrapper>
      <HeadingText>Mint</HeadingText>
      <ToggleBtnWrapper>
        <ToggleBtn
          onClick={() => setActiveTab('Swap')}
          isActive={activeTab === 'Swap'}
        >
          Swap
        </ToggleBtn>
        <ToggleBtn
          onClick={() => setActiveTab('Pool')}
          isActive={activeTab === 'Pool'}
        >
          Pool
        </ToggleBtn>
      </ToggleBtnWrapper>
      {/* <TabWrapper>{activeTab === 'Swap' ? <Swap /> : <Pool />}</TabWrapper> */}
    </MintRedeemWrapper>
  );
};

export default MintRedeeem;
